webpackJsonp([48088938553723],{764:function(t,e){t.exports={data:{wordpressPost:{title:"Global salt intake, smoking cessation through Facebook and the cost of childbirth: Most read articles in January",content:'<p>The most-read article in January was Snow <i>et al.&#8217;s</i> patient led study ‘What happens when patients know more than their doctors?’ on the impact of patient education on the lives of people with diabetes. Hsia <i>et al.</i>’s newly-published cross-sectional study on the variation in charges and prices paid for vaginal and caesarean births has also been popular. Other newly-published papers in the top ten most read include Li <i>et al.</i>&#8216;s analysis on the effect of maternal age and place of birth on intrapartum outcomes, and Cobb <i>et al.</i>’s protocol for an RCT on smoking cessation intervention through Facebook.</p>\n<table width="483" border="1" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Snow <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/11/e003583.full" target="_blank">What happens when patients know more than their doctors? Experiences of health interactions after diabetes patient education: a qualitative patient-led study</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Rao <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/12/e004277.full" target="_blank">Do healthier foods and diet patterns cost more than less healthy options? A systematic review and meta-analysis</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Gómez-Perretta <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/12/e003836.full">Subjective symptoms related to GSM radiation from mobile phone base stations: a cross-sectional study</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Powles <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/12/e003733.full">Global, regional and national sodium intakes in 1990 and 2010: a systematic analysis of 24 h urinary sodium excretion and dietary surveys worldwide</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Hsia <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/1/e004017.full">Analysis of variation in charges and prices paid for vaginal and caesarean section births: a cross-sectional study</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Li <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/1/e004026.full">The effect of maternal age and planned place of birth on intrapartum outcomes in healthy women with straightforward pregnancies: secondary analysis of the Birthplace national prospective cohort study</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Carpenter <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/5/e002299.full">Bed sharing when parents do not smoke: is there a risk of SIDS? An individual level analysis of five major case–control studies</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Ford <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/3/e002269.full" target="_blank">Current treatments in diabetic macular oedema: systematic review and meta-analysis<br />\n</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Krusch <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/11/e003498.full" target="_blank">Mindfulness online: an evaluation of the feasibility of a web-based mindfulness course for stress, anxiety and depression</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Cobb <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/1/e004089.full">Diffusion of an evidence-based smoking cessation intervention through Facebook: a randomised controlled trial study protocol</a></td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p><span style="line-height: 1.5em">Most read figures are based on pdf downloads and full text views. Abstract views are excluded.</span><!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"796aab68-86c6-57e1-a715-50208d1952d8"}}}});
